How to implement calculation that needs non-associative reducer in mongodb mapreduce<p>The question is better to be explained by an example:</p>

<p>A collection contains one document for one event, and the event can be either a "Start" event or a "Stop" event of some program. </p>

<p>For example, when program A start to run at time 12:00, it writes a document</p>

<pre><code>{ program_name: 'A', time: 12:00, event: 'Start' }
</code></pre>

<p>When it is ended at 12:10, it writes another document</p>

<pre><code>{ program_name: 'A', time: 12:10, event: 'Stop' }    
</code></pre>

<p>So in the collection there are many pairs of Start-Stop document for different program.</p>

<p><strong>How can I calculate the elapsed time for each program by map reduce?</strong></p>

<p>For example, the map and reducer functions are:</p>

<pre><code>function map() {
    emit( this.program_name, { time: this.time, event: this.event} )
}

function reduce(key, values) {
    var timeElapsed = 0
    if ( values[0].event == 'Start' ) {
        timeElapsed = values[1].time - values[0].time
    }
    else {
        timeElapsed = values[0].time - values[1].time
    }

    return timeElapse;
}
</code></pre>

<p>The above implementation gives the idea about what I want to do however it violates many <a href="https://docs.mongodb.com/manual/reference/command/mapReduce/#requirements-for-the-reduce-function" rel="nofollow noreferrer">rules</a> says associative, idempotent and commutative. </p>

<p><strong>How to implement a mapreduce such that it conforms the mongodb reducer rules, or it is not possible to do so in mapreduce methodology?</strong></p>

