MongoDb custom Id generator does not get called<p>In my application I have a POCO class called <code>Parameter</code> which is imported from a .csv file and stored in a mongodb collection. As the POCO class is used in projects outside of my repository project, I do not wish to use ObjectId as Id, which would make it neccessary to add references to MongoDb all over the place, where there should be none. Now, There are two different types of Parameters, non-numerical and numerical. The former have a unique code that may look like this <code>A013</code> or this <code>104</code>, the latter have none, so I thought I might use the code for the non-numerical parameters as Id and well, just anything for the numericals. In the end I tried to get a string representation of a Guid for the sake of simplicity (ha!) by not having to manage any numbers or anything. However, I struggle to get it working.</p>

<p>So here's the result:</p>

<pre><code>public class Parameter : INotifyPropertyChanged
{
    public string Id { get; set; }
    public string Name { get; set; }
    public string Unit { get; set; }
    public ParameterType ParameterType { get; set; }
}
</code></pre>

<p>And this is happening during the import of numerical parameters:</p>

<pre><code>.Select((columnName, index) =&gt; new Parameter()
                               {
